import React from "react";
import { Link } from "react-router-dom";

export const Header = () => {
  return (
    <>
      <div class="container mx-auto flex bg-gray-50">
        <Link to="/">Top</Link>
        <ul>
          <li>
            <Link to="/daily">日報</Link>
          </li>
        </ul>
      </div>
      <div class="flex py-8 bg-gray-50 justify-center">
        <div>日報</div>
      </div>
    </>
  );
};
